description:
木の板にキャンバス生地を貼り、ヴィンテージ風に印刷したサインボード。<br>
流行のバスロールサインをイメージしたデザインや、お店の看板にもぴったりなメッセージは壁面に飾るだけでかっこいいインテリアアクセントに。<br>
素材感や経年の風合いも再現され、ショップディスプレイとして植物と一緒に飾っても素敵です。<br>
※背面に壁掛け用の金具あり<br>
<br>
<b>【　仕　様　】</b><br>
カラー：ブラック<br>
素材：MDF、キャンバス<br>
サイズ：w300 d15 h300mm<br>
重量：650g<br>
<br>

<br>
メーカー希望小売価格はメーカーサイトに基づいて掲載しています
